import React from 'react';
import styled from 'styled-components';

function LabelResponseLevel() {
	return (
		<>
			<ComponentWrapper>
				<span>응답률 매우 높음</span>
			</ComponentWrapper>
			<div className="Tooltip_tooltipContent__6exdr">
				지원 후 응답받을 확률이 95% 이상입니다.
			</div>
		</>
	);
}

const ComponentWrapper = styled.div`
	border: 1px solid #00aead;
	color: #00aead;
	border-radius: 2px;
	background-color: #fff;
	display: inline-block;
	font-size: 10px;
	font-weight: 600;
	height: 19px;
	line-height: 19px;
	margin-top: 4px;
	padding: 0 5px;
	> span {
		position: relative;
		line-height: 19px;
		top: -1px;
	}
`;

export default LabelResponseLevel;
